from collections import defaultdict
def frequency_sort(s):
    """
    Given a string 's'
    Sort it in decreasing orderbased on the frequency of the characters
    Return the sorted string
    If there are multiple answers return any of them
    """
    count = defaultdict(int)
    for char in s:
        count[char] += 1
    sorted_chars = sorted(count.items(), key=lambda item:item[1], reverse=True)
    return ''.join([char*freq for char, freq in sorted_chars])
s = ""
print(frequency_sort(s))
test_cases = ["tree", "cccaaa", "Aabb"]
for test in test_cases:
    print(frequency_sort(test))
